}","keccak256":"0x85861468596c9f3ae808e8f1b7793ed61a62437e91d2ac320e44e5a0bea2914a","license":"MIT"},"contracts/aave/interfaces/IERC20.sol":{"content":"// SPDX-License-Identifier: MIT
